import datetime
import random
import time
import requests
import json

BASE_URL = "http://54.169.22.114:7744"
# BASE_URL = "{{URL}}" # to be replaced with player's machine ip
URL_UPLOAD = f"{BASE_URL}/upload"

def run_testcase():
    def upload_image():
        data = {
            "image": "data:image/png;base64,",
            "filename": "something.jpg"
        }

        res = requests.post(URL_UPLOAD, json=data)
        res_body = res.content

        if res.status_code == 200:
            res_body = json.loads(res_body)
            image_url = res_body.get('image_url', None)
            return (True, image_url)
        else:
            return (False, None)
    
    def check_uploaded_image(image_url):
        res = requests.get(f"{BASE_URL}/{image_url}")
        return (True if res.status_code == 200 else False, None)
    
    start_time = datetime.datetime.now(datetime.timezone.utc).isoformat()
    rand_val = random.randint(5, 15)

    status_upload, image_url = upload_image()
    status_get_image, _ = check_uploaded_image(image_url)

    end_time = datetime.datetime.now(datetime.timezone.utc).isoformat()
    return (
        status_upload and status_get_image,
        {
            "start_time": start_time,
            "end_time": end_time,
            "duration": rand_val,
            "message": f"Upload: {status_upload} || Get Image: {status_get_image}"
        }
    )

print(run_testcase())